package com.entity;

public class PointInfo {

	double X;
	double Y;
	double Z;
	
	public PointInfo() {
		// TODO Auto-generated constructor stub
	}

	public Double getX() {
		return X;
	}

	public void setX(Double x) {
		X = x;
	}

	public Double getY() {
		return Y;
	}

	public void setY(Double y) {
		Y = y;
	}

	public Double getZ() {
		return Z;
	}

	public void setZ(Double z) {
		Z = z;
	}

}
